        public static MultiPrecision<N12> Value(MultiPrecision<N12> p, bool is_complementary = false) {
            if (is_complementary) {
                MultiPrecision<N12> y = (p < 0.5) ? CCDF(p) : CDF(1.0 - p);

                return y;
            }
            else {
                MultiPrecision<N12> y = (p < 0.5) ? CDF(p) : CCDF(1.0 - p);

                return y;
            }
        }

        private static MultiPrecision<N12> CDF(MultiPrecision<N12> p) {
            if (p > 0.5) {
                throw new ArgumentOutOfRangeException(nameof(p));
            }

            MultiPrecision<N12> lambda;

            long exponent = p.Exponent;
            if (exponent >= -2) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 1));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm1_2);
            }
            else if (exponent >= -4) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 2));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm2_4);
            }
            else if (exponent >= -8) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 4));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm4_8);
            }
            else if (exponent >= -16) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 8));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm8_16);
            }
            else if (exponent >= -32) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 16));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm16_32);
            }
            else if (exponent >= -64) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 32));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm32_64);
            }
            else if (exponent >= -128) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 64));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm64_128);
            }
            else if (exponent >= -256) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 128));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm128_256);
            }
            else if (exponent >= -512) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 256));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm256_512);
            }
            else if (exponent >= -1024) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 512));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm512_1024);
            }
            else if (exponent >= -2048) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 1024));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm1024_2048);
            }
            else if (exponent >= -4096) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 2048));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm2048_4096);
            }
            else if (exponent >= -8192) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 4096));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm4096_8192);
            }
            else if (exponent >= -16384) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 8192));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm8192_16384);
            }
            else if (exponent >= -32768) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 16384));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm16384_32768);
            }
            else if (exponent >= -65536) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 32768));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm32768_65536);
            }
            else if (exponent >= -131072) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 65536));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm65536_131072);
