            else if (exponent >= -262144) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 131072));
                lambda = ApproxUtil.Pade(-logp, pade_cdf_expm131072_262144);
