        private static MultiPrecision<N12> CCDF(MultiPrecision<N12> p) {
            if (p.Sign == Sign.Minus || p > 0.5) {
                throw new ArgumentOutOfRangeException(nameof(p));
            }

            MultiPrecision<N12> scaled_lambda;

            long exponent = p.Exponent;
            if (exponent >= -2) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 1));
                scaled_lambda = ApproxUtil.Pade(-logp, pade_ccdf_expm1_2);
            }
            else if (exponent >= -4) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 2));
                scaled_lambda = ApproxUtil.Pade(-logp, pade_ccdf_expm2_4);
            }
            else if (exponent >= -8) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 4));
                scaled_lambda = ApproxUtil.Pade(-logp, pade_ccdf_expm4_8);
            }
            else if (exponent >= -16) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 8));
                scaled_lambda = ApproxUtil.Pade(-logp, pade_ccdf_expm8_16);
            }
            else if (exponent >= -32) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 16));
                scaled_lambda = ApproxUtil.Pade(-logp, pade_ccdf_expm16_32);
            }
            else if (exponent >= -64) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 32));
                scaled_lambda = ApproxUtil.Pade(-logp, pade_ccdf_expm32_64);
            }
            else if (exponent >= -128) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 64));
                scaled_lambda = ApproxUtil.Pade(-logp, pade_ccdf_expm64_128);
            }
            else if (exponent >= -240) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 128));
                scaled_lambda = ApproxUtil.Pade(-logp, pade_ccdf_expm128_240);
            }
            else if (exponent >= -360) {
                MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(MultiPrecision<N12>.Ldexp(p, 240));
                scaled_lambda = ApproxUtil.Pade(-logp, pade_ccdf_expm240_360);
            }
            else {
                scaled_lambda = MultiPrecision<N12>.One;
            }

            MultiPrecision<N12> lambda = scaled_lambda / p;

            return lambda;
        }
